import React, { useRef, useEffect } from 'react';
import Logo from '../data/logo.png';
import ServiceVideo from '../data/About-us.mp4';
import img1 from '../data/1Mask group.png';
import img2 from '../data'
import './Style.css';


const SimplePage = () => {
  const videoRef = useRef(null);

  useEffect(() => {
    // Autoplay the video when it's ready
    const video = videoRef.current;
    if (video) {
      video.play().catch(error => {
        console.error('Autoplay was prevented:', error);
        // Fall back to showing custom play button if autoplay was prevented
        video.controls = true;
      });
    }
  }, []);
  return (
    <section className='bg-black-100  p-10'>
      <div className='container   mx-auto flex'>
        <img src={Logo} alt='logo' />
        <div className='flex ml-auto'>
          <button className='lg:hidden'>
            <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="1.5" stroke="currentColor" class="w-6 h-6">
              <path stroke-linecap="round" stroke-linejoin="round" d="M3.75 6.75h16.5M3.75 12h16.5m-16.5 5.25h16.5" />
              </svg>
          </button>
        <ul className=" hidden lg:flex my-auto ">
        <li className="Navi-text text-black pr-5 "><a href=''>Services</a></li>
        <li className="Navi-text text-black pr-5"><a href=''>Technology</a></li>
        <li className="Navi-text text-black pr-5"><a href=''>Lab</a></li>
        <li className="Navi-text text-black pr-5"><a href=''>Case Studies</a></li>
        <li className="Navi-text text-black pr-5"><a href=''>Blog</a></li>
        <li className="Navi-text text-black pr-5"><a href=''>Events/Resources</a></li>
        <li className="Navi-text text-black pr-5"><a href=''>FAQs</a></li>
        <li className="Navi-text text-black pr-5"><a href=''>About Us</a></li>
        <li className="Navi-text text-black pr-5"><a href=''><svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="1.5" stroke="currentColor" class="w-6 h-6">
  <path stroke-linecap="round" stroke-linejoin="round" d="m21 21-5.197-5.197m0 0A7.5 7.5 0 1 0 5.196 5.196a7.5 7.5 0 0 0 10.607 10.607Z" />
</svg>
</a></li>
      </ul>
      </div>
      </div>
      <div className='lg:hidden router container text-customGrey mt-2'>
        Home {'>'} <span className='text-customBlue pl-1'> Services </span> 
      </div>
      <div className='container  mt-32 mx-auto '>
        <h1 className='flex justify-center sm:text-2xl  lg:text-7xl' >Services</h1>
        <p className='flex mt-8 justify-center mx-3 lg:mx-40 text-customGrey text-center text-sm'  >Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also </p>
      </div>
      <div className='container  mt-32 mx-auto Service_video'>
      <video ref={videoRef} className="w-full" autoPlay muted loop playsInline>
          <source src={ServiceVideo} type="video/mp4" />
          Your browser does not support the video tag.
        </video>

      </div>
      <div className='container border mt-32 mx-auto' >
        <div className='container border  border-black flex'>
          <h1>Neurodesign</h1>
          <p>Neurodesign uses neuroscience to create more engaging visual content by analyzing how people perceive and react to design elements.</p>
          <img src=''/>
        </div>
      </div>
    </section>
  );
};

export default SimplePage;
